import React from 'react';
import './App.css';

function App() {
  return (
    <div className="bg-gray-100 min-h-screen flex items-center justify-center">
      <div className="max-w-2xl bg-white p-8 shadow-lg rounded-md">
        <h1 className="text-4xl font-bold mb-4">Your Landing Page</h1>
        <p className="text-gray-600 mb-8">A brief description of your product or service.</p>
        <button className="bg-blue-500 text-white px-4 py-2 rounded-md">Get Started</button>
      </div>
    </div>
  );
}

export default App;
